import styled from 'styled-components'


export const HomeStyle = styled.div`

    .principal {
        text-aling: center;
    }

    img {
        width: 100%;
        margin-top: 12px;
        height: 100%;
    }

    .sobreposicao {
        position: absolute;
        width: 100%;
        background: linear-gradient(0deg, rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5));
        margin-top: 12px;
        height: 800px;
    }

    h1 {
        position: absolute;
        font-style: normal;
        font-weight: 800;
        font-size: 60px;
        line-height: 129px;
        margin-top: 10%;
        margin-left: 10%;
    }




`
